using namespace std;

class Solution_old {
public:
    int numDistinct(string S, string T) {
		int lenS = S.length();
		int lenT = T.length();
		if(lenT > lenS) return 0;
		vector<int> f(lenS+1,0), g(lenS+1,0);
		for(int i=1;i<=lenS;i++) 
		{
			g[i]=g[i-1];
			if(S[i-1]==T[0])
				g[i]=g[i-1]+1;
		}
		for(int j=2;j<=lenT;j++)
		{
			for(int i=j;i<=lenS;i++)
			{
				f[i]=f[i-1];
				if(S[i-1]==T[j-1])
					f[i]+=g[i-1];
			}
			g=f;
			f.assign(lenS+1,0);
		}
		return g[lenS];
    }
};

//2nd pass: 2015-02-20
class Solution_JustDP {
public:
    int f[1000][1000];
    int numDistinct(string S, string T) {
        int lenS=S.length(), lenT=T.length();
        for(int i=0;i<=lenS;i++) f[i][0]=1;
        for(int j=1;j<=lenT;j++)
            for(int i=1;i<=lenS;i++)
            {
                f[i][j]=f[i-1][j];
                if(S[i-1]==T[j-1]) f[i][j]+=f[i-1][j-1];
            }
        return f[lenS][lenT];
    }
};

class Solution {
public:
    int numDistinct(string S, string T) {
        int lenS=S.length(), lenT=T.length();
        if(lenT>lenS) return 0;
        vector<int> g(lenS+1,1),f;
        for(int j=1;j<=lenT;j++)
        {
			f.assign(lenS+1,0);
            for(int i=j;i<=lenS;i++)
                f[i]=(S[i-1]==T[j-1])?f[i-1]+g[i-1]:f[i-1];
			g=f;
        }
        return f[lenS];
    }
};

